import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import AuthContextProvider from './context/'


ReactDOM.render(
    <AuthContextProvider>
    <App />
    </AuthContextProvider>
  ,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
